import React from 'react'
import { useHistory } from 'react-router-dom'

class ActionButton extends React.Component {
   constructor(){
      super();
      const history = userHistory();
   }

   buttonAction(){
      // console.log('hello');
      // <Link to="/shop">
      // </Link>
      history.push("/shop");
   }

   render(){
      return (
         <button id={this.props.id} onClick={this.buttonAction()}>
            {this.props.name}
         </button>
      )
   }
}

export default ActionButton
